import React from 'react';
import styled from 'styled-components';

export default function Index() {
    return (
        <RootView>
            <Title>My page</Title>
        </RootView>
    );
}

const Title = styled.h1`
    font-size: 50px;
    color: ${({ theme }) => theme.colors.primary};
`;

const RootView = styled.div`
    background-color: #000;
`;
